import { Tabs,Tab, Toolbar,  } from '@mui/material';
import AppBar from '@mui/material/AppBar';
 
export const Navbar=()=>{

 

    return(
        <>
        <AppBar>
            <Toolbar disableGutters>
               <Tabs>
                   <Tab label='HOME'/>
                   <Tab label='ABOUT'/>
                   <Tab label='SERVICES'/>
                   <Tab label='CONTACT'/>
               </Tabs>
            </Toolbar>
          
        </AppBar>
        </>
    )
}
